/*
[UPD LOG]
(1.0)
ChatGPT: Censor J*b
Hybrid: Name,Desc,Author,Icon

(1.1)
Claude: Censor Empl*yment

(1.2)
Claude: Red Text
Hybrid: LIGHT Red Text

(1.2.1)
Claude: Fix bug where all of the sentence is red (now just the word)
*/

(function () {
  'use strict';

  function censor(node) {
    if (node.nodeType === 3) {
      const text = node.nodeValue;

      // Check if text contains forbidden words
      if (/\bjob/i.test(text) || /employ/i.test(text)) {
        let newHTML = text;

        // Censor j*b with red span
        newHTML = newHTML.replace(/\b(job)(\w*)\b/gi, (match, p1, p2) => {
          const first = p1[0];
          const last = p1.length > 1 ? p1[p1.length - 1] : '';
          const censored = first + '*' + last + p2;
          return `<span style="color: #FF5151;">${censored}</span>`;
        });

        // Censor empl*y with red span
        newHTML = newHTML.replace(/employ/gi, '<span style="color: #FF5151;">empl*y</span>');

        // Create wrapper and parse HTML
        const wrapper = document.createElement('div');
        wrapper.innerHTML = newHTML;

        // Get parent and insert all child nodes
        const parent = node.parentNode;
        if (parent) {
          const fragment = document.createDocumentFragment();
          while (wrapper.firstChild) {
            fragment.appendChild(wrapper.firstChild);
          }
          parent.replaceChild(fragment, node);
        }
      }
    }
  }

  function walk(node) {
    if (!node) return;
    let child = node.firstChild;
    while (child) {
      const next = child.nextSibling;
      if (child.nodeType === 3) {
        censor(child);
      } else if (child.nodeType === 1) {
        walk(child);
      }
      child = next;
    }
  }

  walk(document.body);

  new MutationObserver(muts => {
    muts.forEach(m =>
      m.addedNodes.forEach(n => walk(n))
    );
  }).observe(document.body, { childList: true, subtree: true });
})();